import React from 'react';
import { useParams } from 'react-router-dom';
import { book } from '../../types';
import { Button } from '../../components/Button';

interface props {
    books: book[];
}

export const Book = ({ books }: props) => {
    const { id } = useParams();
    const filteredBook = books.filter((i) => i.id === (id && parseInt(id)))[0];
    console.log(filteredBook);

    return (
        <div className="flex-coll justify-center bg-red-400 w-full h-full">
            <p className="flex justify-center">Book {filteredBook.name}</p>
            <p>{filteredBook.content}</p>
            <Button onClick={() => console.log('clicked')} content="test" />
        </div>
    );
};
